import React from 'react';
import './WaveAnimation.css';  

const WaveAnimation = () => {
    return (
      <div className="waves-container">
        
        <div className="wave wave1" ></div>
        
        <div className="wave wave2" ></div>
        <div className="wave wave3" ></div>
      </div>
    );
  };
export default WaveAnimation;
